import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

const MediaSocial = (props) => (
  <>
    <FontAwesomeIcon icon={faFacebook} color="blue" size={70} className={'mb-0 mt-12 mx-auto'}/>
    <FontAwesomeIcon icon={faInstagram} color="blue" size={70} className={'mb-0 mt-12 mx-auto'}/>
  </>
);

export default MediaSocial
